import Navbar from './components/Navbar';
import Carousel from './components/Carousel';
import { BrowserRouter, } from 'react-router-dom';


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Navbar />
        <Carousel />
      </BrowserRouter>

    );
  }

}

export default App;
